const MasterOccupationEnter = ({occupation, setOccupation}) => {
    return(<div className="phaseBlock">
        <h1>Чем вы занимаетесь?</h1>
        <a>Укажите все наши специальность — так подходящий заказов будет больше.</a>
        <input placeholder="Род деятельности" value={occupation} onChange={e => setOccupation(e.target.value)} className="inputField"></input>
        <div className="hints">
            <button className="hint" value={"Ремонт компьтеров"}>Ремонт компьтеров</button>
            <button className="hint" value={"Ремонт стиральных машин"}>Ремонт стиральных машин</button>
            <button className="hint" value={"Сантехника"}>Сантехника</button>
            <button className="hint" value={"Устранение засоров"}>Устранение засоров</button>
            <button className="hint" value={"Спальни"}>Спальни</button>
            <button className="hint" value={"Протечка воды"}>Протечка воды</button>
        </div>
    </div>);
};

export default MasterOccupationEnter;
